import React from 'react';

function Dashboard() {

    const componentHeading = () => {
        document.getElementById('loader-heading').innerText = 'Dashboard';
    }
    return (
        <>
            <div>
                Dashboard
            </div>
            {componentHeading()}
        </>
    );
}

export default Dashboard;
